import React, { Component } from 'react'
import { MyContext } from './App';
export default class Guest extends Component {
    render() {
        return (
            <div>
               <MyContext.Consumer>
                    {data =>( 
                        <h2>
                        Name: {data.name} Value: {data.value}
                        </h2>)}
               </MyContext.Consumer>
            </div>
        )
    }
}
